import React from "react";
import {
  Button,
  Grid,
  List,
  ListItem,
  ListItemText,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Typography,
} from "@mui/material";

import "./adminDash.css";

export default function UserDash() {
  return (
    <Grid
      container
      sx={{
        padding: "10em 7em 4em",
      }}
    >
      <Grid
        item
        width={"50%"}
        sx={{
          padding: "2em",
        }}
      >
        <div className="admin_widget">
          <h1> HEY ME</h1>
        </div>
      </Grid>
      <Grid
        item
        width={"50%"}
        sx={{
          padding: "2em",
        }}
      >
        <Typography
          variant="h3"
          sx={{
            color: "#ffffff",
          }}
        >
          Upload a picture of a crop to get more info
        </Typography>
        <div className="predict_btn">
          <Button
            variant="contained"
            size="large"
            sx={{
              color: "#ffffff",
              background: "#308335",
              padding:"1em",
            }}
          >
            CHECK
          </Button>
        </div>
      </Grid>
    </Grid>
  );
}
